import logo from './img/Unofficial_JavaScript_logo_2.svg.png'
import './App.css';
import 'animate.css'
import React from 'react';
import { BrowserRouter, Routes, Route, NavLink, Link, Router } from 'react-router-dom';
import Navbar from './Components/Navbar/Navbar';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo, animate__heartBeat" alt="logo" />
          <ul>
            <li>
              <Link to={<Navbar />}
                className={({ isActive }) => (isActive ? " active" : "")}>Learn Java Script</Link>

            </li>

          </ul>

        </header>
      </div>

    </BrowserRouter>
  );
}

export default App;
